window.bookSummaryJSON = "<p><b>A full-cast performance of a thrilling new episode in the </b><b><i>New York Times</i></b><b> best-selling Expeditionary Force series.</b></p> <p>After the latest mission of the starship <i>Flying Dutchman</i>, Earth is safe not just for a year, but for hundreds of years. The ship’s weary crew wonders what they will do with their lives in peacetime, but the enemy has other plans, and there is danger on the Homefront.</p> <p>Starring Zachary Quinto, R.C. Bray, Kate Mulgrew, Robert Picardo, and everyone's favorite AI, Skippy the Magnificent, alongside a full cast. Includes plenty of pew-pew-pew, original sound composition, and maybe some singing by R.C. Bray.</p> <p>Produced by Odd Origin Media and Dagaz Media</p> <p>Executive Producer Greg Lawrence </p> <p>Story by Craig Alanson</p> <p>Script by Craig Alanson and Jack Bowman</p> <p>Talent Director William Dufris</p> <p>Sound Director Fred Greenhalgh</p> <p>Associate Producer Casey Turner</p> <p>Dialogue edited by Jack Bowman</p> <p>Sound design by Jamie Mahaffey/The Mix Room and O'Shea Creative Media </p> <p>Music by Jeroen Grommen </p> <p>Check out exclusive bonus content at homefrontaudio.com. </p> <p>Full cast includes: Zachary Quinto, R.C. Bray, Kate Mulgrew, Robert Picardo, Peter Berkrot, Kym Dakin, Bill Dufris, Corey Gagne, Nimo Gandhi, Emily Grotz, Dalton S. Kimball, Austin Ku, Daniel Logan, John Dalton Logan, PJ Ochlan, Lisa Renee Pitts, Christopher Price, Michael Rafkin, Lisa Stathoplos, Casey Turner, Jennywren Walker, Marjolaine Whittlesey, Ashanti Williams, Jonathan Woodward, and Collin Young.</p>"; 
